import PeoplePage from '../containers/PeoplePage';
import HomePage from '../containers/HomePage';
import NotFondPage from '../containers/NotFondPage'

export const routesConfig = [
    {
        path: '/',
        element: <HomePage/>,
    },
    {
        path: '/people',
        element: <PeoplePage/>,
    },
    {
        path: '/not-found',
        element: <NotFondPage/>,
    },
    {
        path: '*',
        element: <NotFondPage/>,
    }

]
export {routesConfig as default};
